@test integrate(x^-5*(c+-1*c*a^-2*x^-2)^(1/2)*exp(-3*arccoth(a*x)), x) == :(3//4*x^-4*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2)+-4*a^3*x^-1*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2)+-4*a^4*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2)*log(x)+2*a^2*x^-2*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2)+4*a^4*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2)*log(1+a*x)+-4//3*a*x^-3*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2)+-1//5*a^-1*x^-5*(1+-1*a^-2*x^-2)^-1//2*(c+-1*c*a^-2*x^-2)^(1/2))
